import React from 'react';
import Home from './Home'
import Navbar from './Navbar'
import { BrowserRouter,Switch,Route } from "react-router-dom";
function App() {
  return (
    <div>
      <BrowserRouter>
      <Navbar/>
      <Home/>
      <Switch>
      <Route path="/" exact component={Home}/>
      {/* <Route path="/"  component={ShowWeather}/> */}
      </Switch>

     </BrowserRouter>

    </div>
  );
}

export default App;
